Let $C$ be the cost of carpeting a floor and $A$ be the area.  By the definition of a direct proportion, we know that $C=kA$, where $k$ is a constant.  Substituting $105$ for $C$ and $14\times 5=70$ for $A$, we can find that $k=3/2$.  Then, the cost to carpet a floor that is $16\times13$ square feet will be: \begin{align*}
C&=kA\\
&=(3/2)(16\times13)\\
&=\boxed{312 \text{ dollars}}.
\end{align*}

First, we write out the problem in equation form:

\begin{align*}
a + 2b &= 15, \\
a + 5b &= 3.
\end{align*}

Subtracting the first equation from the second, we have $3b = -12 \implies b = -4$. Then, substituting $b = -4$ into the first equation: \begin{align*}
a + 2(-4) &= 15, \\
a &= 23.
\end{align*} so $a + b = 23 - 4 = \boxed{19}$.

We can use Pascal's identity $ \binom{n-1}{k-1}+\binom{n-1}{k}=\binom{n}{k}$ to find $\binom{15}{9}$.

\begin{align*}
\binom{15}{8}+\binom{15}{9}&=\binom{16}{9} \rightarrow \\
6435+\binom{15}{9}&=11440 \rightarrow \\
\binom{15}{9}&=5005
\end{align*}

We can use the identity again to find $\binom{15}{10}$.

\begin{align*}
\binom{15}{9}+\binom{15}{10}&=\binom{16}{10} \rightarrow \\
5005+\binom{15}{10}&=8008 \rightarrow \\
\binom{15}{10}&=3003
\end{align*}

Therefore, $\binom{15}{10}=\boxed{3003}$.

