correct_answer:
We first note that each circle can intersect any other circle a maximum of two times.

To begin, the first circle is drawn. The second circle is then drawn overlapping the first, and two points of intersection are created. Since each pair of circles overlap (but are not exactly on top of one another), then the third circle drawn can intersect the first circle twice and the second circle twice. We continue in this manner with each new circle drawn intersecting each of the previously drawn circles exactly twice. That is, the third circle drawn intersects each of the two previous circles twice, the fourth circle intersects each of the three previous circles twice, and so on.  Diagrams showing possible arrangements for $3,$ $4,$ and $5$ circles, each giving the maximum number of intersections, are shown below.

[asy]
draw((Circle((-6,.2),1)));
draw((Circle((-5,.2),1)));
draw((Circle((-5.5,1.2-sqrt(3)),1)));
draw((Circle((-2,-0.3),1)));
draw((Circle((-2,0.3),1)));
draw((Circle((-.5,-0.3),1)));
draw((Circle((-.5,0.3),1)));

draw((Circle((3.6,.3),1)));
draw((Circle((2,.3),1)));
draw((Circle((2.3,-0.3),1)));
draw((Circle((3.3,-0.3),1)));
draw((Circle((2.8,.8),1)));
[/asy]


The resulting numbers of intersections are summarized in the table below.

\begin{tabular}{|c|c|c|}\hline
Circles&New intersections&Total number of intersections\\ \hline
1&0&0\\ \hline
2&2&2\\ \hline
3&$2\times2=4$&$2+4$\\ \hline
4&$3\times2=6$&$2+4+6$\\ \hline
5&$4\times2=8$&$2+4+6+8$\\ \hline
6&$5\times2=10$&$2+4+6+8+10$\\ \hline
\end{tabular}

Continuing in this vein, the greatest possible total number of intersection points using ten circles is\[2+4+6+8+10+12+14+16+18=\boxed{90}.\] Or, we notice that every unique pair of circles carries at most two unique intersections. There are $\binom{10}{2} = \frac{10\cdot 9}{2!} = 45$ different pairs of circles, which give a total of $2\cdot 45 = \boxed{90}$ possible intersections.

To be complete, we technically need to show that this number is possible, though we don't expect students to do this to answer the question. The diagram below demonstrates a possible positioning of the ten circles that achieves the maximum $90$ points of intersection. That is, every pair of circles intersects exactly twice and all points of intersection are distinct from one another. It is interesting to note that this diagram is constructed by positioning each of the ten circles' centres at one of the ten vertices of a suitably sized regular decagon, as shown.

[asy]
draw((.31,-.95)--(0,0)--(.31,.95)--(1.12,1.54)--(2.12,1.54)--(2.93,.95)--(3.24,0)--(2.93,-.95)--(2.12,-1.54)--(1.12,-1.54)--cycle,linewidth(1));
draw((Circle((.31,-.95),2.12)));
draw((Circle((0,0),2.12)));
draw((Circle((.31,.95),2.12)));
draw((Circle((1.12,1.54),2.12)));
draw((Circle((2.12,1.54),2.12)));
draw((Circle((2.93,.95),2.12)));
draw((Circle((3.24,0),2.12)));
draw((Circle((2.93,-.95),2.12)));
draw((Circle((2.12,-1.54),2.12)));
draw((Circle((1.12,-1.54),2.12)));
[/asy]

Consider the four random points before they are labeled $A$, $B$, $C$, or $D$. In the general case, they will be distinct, forming a convex quadrilateral. Suppose $A$ is labeled. If $B$ is labeled as the vertex opposite $A$, segments $AB$ and $CD$ will intersect; otherwise, they will not. Since there are 3 points to label as $B$, the probability these segments intersect is $\boxed{\frac{1}{3}}$. [asy]
draw((0,1)..(1,0)..(0,-1)..(-1,0)..cycle);
dot((0,1)); dot((-5/13,-12/13)); dot((-1,0)); dot((4/5,3/5));
label("$A$",(0,1),N); label("$B$",(-5/13,-12/13),SSW); label("$C$",(-1,0),W); label("$D$",(4/5,3/5),NE);
draw((0,1)--(-5/13,-12/13),green); draw((-1,0)--(4/5,3/5),green);
draw((0,1)--(4/5,3/5),blue); draw((-1,0)--(-5/13,-12/13),blue);
draw((0,1)--(-1,0),red); draw((-5/13,-12/13)--(4/5,3/5),red);
[/asy] In this diagram, the green edges represent the labeling where $AB$ and $CD$ intersect, and the blue and red edges represent the equally likely labelings where $AB$ and $CD$ do not intersect.

The probability of the number appearing 0, 1, and 2 times is \begin{align*}
&P(0) = \frac{3}{4}\cdot \frac{3}{4} = \frac{9}{16},\\
&P(1) = 2\cdot\frac{1}{4}\cdot \frac{3}{4} = \frac{6}{16},
\quad\text{and}\\
&P(2) = \frac{1}{4}\cdot \frac{1}{4} = \frac{1}{16},
\end{align*} respectively. So the expected return, in dollars, to the player is \begin{align*}
P(0)\cdot (-1) + P(1)\cdot (1) + P(2)\cdot (2) &= \frac{-9 + 6 +
2}{16} \\
&= \boxed{-\frac{1}{16}}.
\end{align*}

